import settings from './settings';
import unformat from './unformat';
import toFixed from './toFixed';
import formatNumber from './formatNumber';
import formatMoney from './formatMoney';
import formatColumn from './formatColumn';

export {
  settings,
  unformat,
  toFixed,
  formatMoney,
  formatNumber,
  formatColumn,
  formatMoney as format,
  unformat as parse
};

/**
 * The library's settings configuration object.
 *
 * Contains default parameters for currency and number formatting.
 *
 * @type Object
 */
const settings = {
  /**
   * Currency symbol
   *
   * @type {String}
   */
  symbol: '$',
  /**
   * Controls output: %s = symbol, %v = value (can be object, see docs)
   *
   * @type {String|Object}
   */
  format: '%s%v',
  /**
   * Decimal point separator
   *
   * @type {String}
   */
  decimal: '.',
  /**
   * Thousands separator
   *
   * @type {String}
   */
  thousand: ',',
  /**
   * Decimal places
   *
   * @type {Number}
   */
  precision: 2,
  /**
   * Digit grouping (not implemented yet)
   *
   * @type {Number}
   */
  grouping: 3,
  /**
   * Strip insignificant zeros from decimal part
   *
   * @type {Boolean}
   */
  stripZeros: false,
  /**
   * Value returned on unformat() failure
   *
   * @type {Float}
   */
  fallback: 0
};

export default settings;

import checkPrecision from './internal/checkPrecision';
import settings from './settings';

/**
 * Implementation of toFixed() that treats floats more like decimals.
 *
 * Fixes binary rounding issues (eg. (0.615).toFixed(2) === '0.61') that present
 * problems for accounting- and finance-related software.
 *
 * **Usage:**
 *
 * ```js
 * // Native toFixed has rounding issues
 * (0.615).toFixed(2);
 * // => '0.61'
 *
 * // With accounting-js
 * toFixed(0.615, 2);
 * // => '0.62'
 * ```
 *
 * @access public
 * @param {Float} value - Float to be treated as a decimal number
 * @param {Number} [precision=settings.precision] - Number of decimal digits to keep
 * @return {String} - Given number transformed into a string with the given precission
 */
function toFixed(value, precision) {
  precision = checkPrecision(precision, settings.precision);
  const power = Math.pow(10, precision);

  // Multiply up by precision, round accurately, then divide and use native toFixed()
  return (Math.round((value + 1e-8) * power) / power).toFixed(precision);
}

export default toFixed;

